const Label = ({ todo }) => {
  return (
    <h3>
      <label className={todo.completed == 1 ? 'completed' : null}>
        {todo.todoname}
      </label>
      <label onClick={() => deleteTodo(todo.id)}>&nbsp;&nbsp;삭제</label>
    </h3>
  );
};
export default Label;
